import TextField from '@material-ui/core/TextField'

import React from 'react';

import { makeStyles } from '@material-ui/core/styles';
import Card from '@material-ui/core/Card';
import CardActions from '@material-ui/core/CardActions';
import CardContent from '@material-ui/core/CardContent';
import Button from '@material-ui/core/Button';
import Typography from '@material-ui/core/Typography';
import './5fin.css'


function Final(props) {
  const {setStep, userData, setUserData } = props

  var value = userData.dailyBudget;
  const lead = value / 5;

  const lod = (value * 2) / 5;

    return (
      <div>
        <div className="body">
        <header  className="item">
            <h2> Congratulations!</h2>
            <h3> Your campaign is being processed. We will start delivering the first lead within the next 24 hours.</h3>
            </header>

            <body className="item-1">
            <Card variant="outlined" color= 'textSecondary'>
            <CardContent >

    <TextField
    type="text"
    disabled="true"
    value={ `Leads per day: ${Math.ceil(lead)}-${Math.ceil(lod)}`}
    onChange={(e) =>
      setUserData({ ...userData, perDayLead: e.target.value })
    }

  />

    <TextField
    type="text"
    disabled="true"
    value={ `Cost per Lead: ${lead / 4}-${lod / 4}`}
    onChange={(e) =>
      setUserData({ ...userData, perLeadCost: e.target.value })
    }
  />



    <TextField
    type="text"
    disabled="true"
    value={userData["startdate"]}
    onChange={(e) =>
        setUserData({ ...userData, startdate: e.target.value })
      }
      placeholder="Date"
    />{" "}
  <TextField
    type="text"
    disabled="true"
    value={userData["enddate"]}
    onChange={(e) =>
      setUserData({ ...userData, enddate: e.target.value })
    }
    placeholder="Date"
  />{" "}
            </CardContent>


            <CardActions>
            </CardActions>
          </Card>
            </body>

        </div>
        <Button size='large' onClick={()=> setStep(4)}>Previous </Button>

        </div>
    )
}

export default Final
